<template>
    <image xlink:href="/img/rotate-screen_phone_01.png" width="100%" height="100%" preserveAspectRatio="xMidYMid slice" v-if="isLandscape"/> <!-- eslint-disable-line vue/attribute-hyphenation -->
    <g v-else stroke="none" stroke-width="1" fill="none" fill-rule="evenodd" :transform="coordinateTransform">
        <g fill="#FFFFFF" fill-rule="nonzero" :transform="`scale(${scale})`">
            <polygon id="path-1" points="0 330 190 330 190 0 0 0" transform="scale(1.12)"></polygon>
        </g>

        <g :fill="instagramGrayColor" fill-rule="nonzero" :transform="`scale(${scale})`">
            <polygon id="path-3" points="0 25.8804692 190 25.8804692 190 0 0 0"></polygon>
        </g>
        <g :transform="`scale(${scale})`">
            <g id="author-furniture" transform="scale(1.12)">
                <path d="M4.07228916,41.7409639 C4.07228916,46.2391466 7.71868475,49.8855422 12.2168675,49.8855422 C16.7150502,49.8855422 20.3614458,46.2391466 20.3614458,41.7409639 C20.3614458,37.2427811 16.7150502,33.5963855 12.2168675,33.5963855 C7.71868475,33.5963855 4.07228916,37.2427811 4.07228916,41.7409639 Z"
