                      :fill="instagramGrayColor" fill-rule="nonzero"></path>
                <polygon :fill="instagramGrayColor" fill-rule="nonzero"
                         points="23.4156627 40.7228916 73.3012048 40.7228916 73.3012048 36.6506024 23.4156627 36.6506024"></polygon>
                <polygon :fill="instagramGrayColor" fill-rule="nonzero"
                         points="23.4156627 47.8493976 86.5361446 47.8493976 86.5361446 43.7771084 23.4156627 43.7771084"></polygon>
            </g>
        </g>

        <g id="media-content" :transform="`translate(0 ${65*scale})`">
            <mask id="mask-2" fill="white">
                <use xlink:href="#path-1"></use>
            </mask>
            <g id="path-7"></g>

            <g id="media" x="0" y="0" v-if="format.id === 'FacebookCarouselAdPost'" ref="carouselSwipable"
               :style="{transform: `translate(${swipeOffset}px, 0px)`}"
               class="carousel"
               :class="{'carousel--animate-transform': !isSwiping}">
                <g v-for="(card, index) in carouselItems" :key="index"
                   :style="{transform: `translate(${dimensions.width*index}px, 0px)`}">
                    <template v-if="card.isVideoTranscoding">
                        <preview-video-placeholder :key="index" :width="dimensions.width"
                                                   :height="dimensions.width" :font-size="9"
                                                   :text="transcodingTextShort"></preview-video-placeholder>
                    </template>

                    <g v-show="!card.isVideoTranscoding">
                        <rect v-show="card.type === 'video'" :width="dimensions.width" :height="dimensions.width" fill="black"/>
                        <image v-show="!card.animatedImageUrl" :xlink:href="card.url" :width="dimensions.width" :height="dimensions.width" ref="carouselVideoPosition"/>
                        <image v-show="card.animatedImageUrl" :xlink:href="card.animatedImageUrl" :width="dimensions.width" :height="dimensions.width" ref="carouselGif"/>

                        <foreignObject v-show="videoPlaying === 'video' + index" ref="carouselVideoContainer"
                                       width="1" height="1" style="overflow: visible">
                            <div style="position: relative">
                                <video playsinline class="video" :class="{'video--animate-transform': !isSwiping}"
                                       ref="carouselVideo"
                                       :width="dimensions.width" :height="dimensions.width"
                                       :src="card.videoUrl" style="object-fit: contain"
                                       @click="handleCarouselCardClick(index)"
                                       @ended="replayVideo($refs.carouselVideo[index], 'video' + index)"></video>

                                <div class="video__sound-icon-placeholder" v-show="!isSwiping && carouselItems[carouselIndex].videoUrl"></div>
                            </div>

                        </foreignObject>
                    </g>
                </g>
            </g>
            <g id="media" x="0" y="0" v-else>
                <image v-if="thumbnailUrl" :xlink:href="thumbnailUrl"
                       :width="mediaContentDimensions.width"
                       :height="mediaContentDimensions.height" preserveAspectRatio="xMidYMid slice"/> <!-- eslint-disable-line vue/attribute-hyphenation -->
                <image v-else :width="mediaContentDimensions.width" :height="mediaContentDimensions.height" xlink:href="data:image/png;base64,"/>

                <template v-if="isVideoTranscoding">
                    <preview-video-placeholder :width="mediaContentDimensions.width"
                                               :height="mediaContentDimensions.height" :font-size="9"
                                               :text="transcodingTextShort"></preview-video-placeholder>
                </template>

                <g v-show="!isVideoTranscoding">
                    <image v-show="videoUrl" :xlink:href="thumbnailUrl" :width="mediaContentDimensions.width" :height="mediaContentDimensions.height" ref="videoPosition" preserveAspectRatio="xMidYMid slice"/> <!-- eslint-disable-line vue/attribute-hyphenation -->
                    <image v-show="animatedImageUrl" :xlink:href="animatedImageUrl" :width="mediaContentDimensions.width" :height="mediaContentDimensions.height" ref="gif" preserveAspectRatio="xMidYMid slice"/> <!-- eslint-disable-line vue/attribute-hyphenation -->
                    <!-- eslint-disable-line vue/attribute-hyphenation -->

                    <foreignObject v-show="videoPlaying === 'video'" ref="videoContainer"
                                   width="1" height="1" style="overflow: visible">
                        <div style="position: relative">
                            <video playsinline ref="video" @ended="replayVideo($refs.video, 'video')"
                                   :width="mediaContentDimensions.width" :height="mediaContentDimensions.height"
                                   :src="videoUrl" @click="toggleVideoSound"></video>

                            <div class="video__sound-icon-placeholder"></div>
                        </div>
                    </foreignObject>
                </g>
            </g>
        </g>

        <g transform="scale(1.12)">
            <g id="below-media-content" :transform="`scale(${scale}) ` + mediaContentPushTransform">
                <g id="post-text-content">
                    <g transform="translate(6.108434, 189.927711)" :fill="instagramGrayColor" fill-rule="nonzero">
                        <path d="M0,4.57271379 C0,7.09818554 2.12758059,9.14542757 4.75215766,9.14542757 C7.37673473,9.14542757 9.50431532,7.09818554 9.50431532,4.57271379 C9.50431532,2.04724204 7.37673473,-2.84217094e-14 4.75215766,-2.84217094e-14 C2.12758059,-2.84217094e-14 0,2.04724204 0,4.57271379 Z"></path>
                        <path d="M146.78887,4.57271379 C146.78887,7.09818554 148.916451,9.14542757 151.541028,9.14542757 C154.165605,9.14542757 156.293185,7.09818554 156.293185,4.57271379 C156.293185,2.04724204 154.165605,-2.84217094e-14 151.541028,-2.84217094e-14 C148.916451,-2.84217094e-14 146.78887,2.04724204 146.78887,4.57271379 Z"></path>
                        <path d="M17.4245781,4.57271379 C17.4245781,7.09818554 19.5521587,9.14542757 22.1767357,9.14542757 C24.8013128,9.14542757 26.9288934,7.09818554 26.9288934,4.57271379 C26.9288934,2.04724204 24.8013128,-2.84217094e-14 22.1767357,-2.84217094e-14 C19.5521587,-2.84217094e-14 17.4245781,2.04724204 17.4245781,4.57271379 Z"></path>
                        <path d="M34.8491562,4.57271379 C34.8491562,7.09818554 36.9767368,9.14542757 39.6013138,9.14542757 C42.2258909,9.14542757 44.3534715,7.09818554 44.3534715,4.57271379 C44.3534715,2.04724204 42.2258909,-2.84217094e-14 39.6013138,-2.84217094e-14 C36.9767368,-2.84217094e-14 34.8491562,2.04724204 34.8491562,4.57271379 Z"></path>
                    </g>

                    <g fill-rule="nonzero"
                       v-if="format.id === 'FacebookCarouselAdPost'" transform="translate(80 195) scale(0.6)">
                        <g :style="carouselDotsShift">
                            <path v-for="(dot, index) in carouselDotsComputed" :key="index"
                                  d="M0 0c0 1.65687 1.34313 3 3 3 1.65688 0 3-1.34313 3-3 0-1.65688-1.34312-3-3-3-1.65687 0-3 1.34312-3 3z"
                                  :fill="dot.fill" :transform="dot.transform"/>
                        </g>
                    </g>

                    <polygon :fill="instagramGrayColor" fill-rule="nonzero"
                             points="6.10843373 213.343373 37.6686747 213.343373 37.6686747 209.271084 6.10843373 209.271084"></polygon>

                    <foreignObject :x="postTextOffset.x" :y="postTextOffset.y" width="140" height="30" overflow="hidden"
                                   font-family="SF UI Text Regular" font-size="8">
                        <pre ref="postTextElement" xmlns="http://www.w3.org/1999/xhtml"
                             style="max-height: 100%; text-align: left; margin:0; white-space: pre-wrap; font-family: SF UI Text Regular;"
                             v-html="formattedPostText"></pre>
                    </foreignObject>
                </g>

                <g id="bottom-dummy-content" :transform="bottomDummyContentTransform" :fill="instagramGrayColor"
                   fill-rule="nonzero">
                    <polygon points="0 35.8748671 118.044944 35.8748671 118.044944 31.6906846 0 31.6906846"></polygon>
                    <polygon points="0 20.1841826 125.455837 20.1841826 125.455837 16 0 16"></polygon>
                    <polygon points="0 28.0295248 147.159168 28.0295248 147.159168 23.8453423 0 23.8453423"></polygon>
                    <polygon points="0 43.7202094 140.806974 43.7202094 140.806974 39.5360268 0 39.5360268"></polygon>
                    <polygon points="0 4.87486712 118.044944 4.87486712 118.044944 0.690684565 0 0.690684565"></polygon>
                    <polygon points="0 12.7202094 140.806974 12.7202094 140.806974 8.53602685 0 8.53602685"></polygon>
                    <g transform="translate(-6, 60.000000)" :fill="instagramGrayColor" fill-rule="nonzero">
                        <polygon points="0 100 169 100 169 0 0 0"></polygon>
                    </g>
                </g>
            </g>
        </g>

    </g>
</template>

<script>
import _ from 'lodash'
import PreviewVideoPlaceholder from '../shared/preview_video_placeholder.vue'
import { template } from './instagram_mute_icon'
import { FacebookPreviewMixin, FacebookPhotoPreviewMixin, FacebookVideoPreviewMixin, SwipableCarouselMixin } from './facebook_mixins.js'

const IS_FIREFOX = navigator.userAgent.toLowerCase().includes('firefox')

export default {
    components: {
        previewVideoPlaceholder: PreviewVideoPlaceholder,
    },
    mixins: [FacebookPreviewMixin, FacebookPhotoPreviewMixin, FacebookVideoPreviewMixin, SwipableCarouselMixin],
    props: {
        format: { type: Object, required: true },
        isInteractive: { type: Boolean, required: true },
        postText: { type: String, required: false },
        link: { type: String, required: false },
        thumbnailUrl: { type: String, required: false },
        videoUrl: { type: String, required: false },
        animatedImageUrl: { type: String, required: false },
        isVideoTranscoding: { type: Boolean, required: false },
        carouselItems: { type: Array, required: false, default: ()=>[] },
    },
    data () {
        let initialImageAspectRatio = 1

        return {
            postTextHeight: 10,
            isLandscape: false,
            postTextInitialHeight: 10,
            initialImageAspectRatio: initialImageAspectRatio,
            imageAspectRatio: initialImageAspectRatio,
            carouselIndex: 0,
            bigDotsStartIndex: 0,
            videoMuted: true,
            showCarouselMuteIcon: false,
            dimensions: { width: 100, height: 400 },
        }
    },
    computed: {
        scale () {
            return this.dimensions.width / 190
        },
        coordinateTransform () {
            return `scale(${100 / this.dimensions.width})`
        },
        leftCard () {
            if (this.carouselIndex >= this.carouselItems.length - 2 && this.carouselItems.length > 1) {
                return this.carouselItems[this.carouselItems.length - 2] || {}
            }
            return this.carouselItems[this.carouselIndex] || {}
        },
        rightCard () {
            if (this.carouselIndex >= this.carouselItems.length - 2 && this.carouselItems.length > 1) {
                return this.carouselItems[this.carouselItems.length - 1] || {}
            }
            return this.carouselItems[this.carouselIndex + 1] || {}
        },
        formattedPostText () {
            let escapedText = _.escape(this.postText)
            let truncatedText = escapedText.length > 125 ? `${escapedText.substring(0, 125)}...` : escapedText
            let postTextArray = truncatedText.split(' ').map((text) => {
                if (text.startsWith('http')) {
                    return `<span style="cursor: pointer; color: ${this.facebookLinkColor};">${text}</span>`
                } else {
                    return text
                }
            })

            let text = postTextArray.join(' ')

            // add 17 spaces to the beginning because of offset
            return `${' '.repeat(17)}${text}`
        },
        mediaContentDimensions () {
            // Only aspect ratios between 4:5 and 1.91 are supported, images are cropped to fit if required
            let aspectRatio = Math.min(Math.max(4 / 5, this.imageAspectRatio), 1.91)
            let width = this.dimensions.width
            let height = width / aspectRatio

            return { width, height }
        },
        mediaContentPushTransform () {
            // 1.12 * this.scale to offset for scaling of container
            let translateY = 45 + (this.mediaContentDimensions.height - this.dimensions.width) / (1.12 * this.scale)
            return `translate(0, ${translateY})`
        },
        bottomDummyContentTransform () {
            let postTextPushY = this.postTextHeight - this.postTextInitialHeight
            let translateY = postTextPushY + 220

            return `translate(6 ${translateY})`
        },
        carouselDots () {
            let dots = []

            if (this.carouselItems.length <= 5) {
                // No fancy dots if there's less than 6 cards
                return this.carouselItems.map((c, idx) => {
                    return {
                        fill: idx === this.carouselIndex ? this.instagramBlueColor : this.instagramGrayColor,
                        scale: 1,
                    }
                })
            }

            _.range(Math.min(2, this.bigDotsStartIndex)).forEach((idx) => {
                if (this.bigDotsStartIndex === 1) {
                    dots.push({ fill: this.instagramGrayColor, scale: 0.75 })
                } else {
                    dots.push({
                        fill: this.instagramGrayColor,
                        scale: idx === 0 ? 0.5 : 0.75,
                    })
                }
            })
            _.range(3).forEach((idx) => {
                dots.push({
                    fill: this.bigDotsStartIndex + idx === this.carouselIndex ? this.instagramBlueColor : this.instagramGrayColor,
                    scale: 1,
                })
            })
            _.range(Math.min(2, this.carouselItems.length - this.bigDotsStartIndex - 3)).forEach((idx) => {
                dots.push({
                    fill: this.instagramGrayColor,
                    scale: idx === 0 ? 0.75 : 0.5,
                })
            })
            return dots
        },
        carouselDotsComputed () {
            return this.carouselDots.map((dot, index) => {
                return {
                    transform: `translate(${index * 10} 0) scale(${dot.scale})`,
                    fill: dot.fill,
                }
            })
        },
        carouselDotsShift () {
            if (this.carouselItems.length <= 5) {
                // No fancy dots (and no dots shift) if there's less than 6 cards
                return { transform: `translate(-20px, 0px)` }
            }
            let translateX = -10 * Math.min(2, this.bigDotsStartIndex)
            return { transform: `translate(${translateX}px, 0px)`, transition: 'transform 200ms' }
        },
        maxHeight () {
            return this.isLandscape ? this.dimensions.height : Math.max(720, this.dimensions.height, this.dimensions.width*2)
        },
    },
    watch: {
        formattedPostText (val) {
            this.$nextTick(() => {
                this.adjustToPostText()
            })
        },
        thumbnailUrl (val) {
            if (val) {
                this.$nextTick(this.measureInstagramThumbnailAspectRatio)
            } else {
                // reset aspect ratio to initialImageAspectRatio if image removed
                this.imageAspectRatio = this.initialImageAspectRatio
            }
        },
        dimensions () {
            if (!this.isLandscape) {
                if (this.format.id === 'FacebookCarouselAdPost') {
                    this.$nextTick(() => {
                        this.appendMuteIconHTML()
                        this.handleVideosOnSwipeEnd()
                    })
                }
                if (this.format.id === 'FacebookVideoAdPost') {
                    this.$nextTick(() => {
                        this.appendMuteIconHTML()
                        this.triggerAutoplay()
                    })
                }
            }
        },
        videoMuted (muted) {
            document.querySelectorAll('.video__sound-icon .unmuted').forEach((e)=>e.style.visibility = muted ? 'hidden': 'visible')
            document.querySelectorAll('.video__sound-icon .muted').forEach((e)=>e.style.visibility = muted ? 'visible': 'hidden')
        },
        isLandscape (landscape) {
            if (landscape){
                window.scrollTo(0, 0)
            }
        },
    },
    created () {
        this.instagramGrayColor = '#E7E7E7'
        this.instagramBlueColor = '#0095EB'
        this.transcodingTextShort = 'We’re processing this video.'
        this.postTextOffset = { x: 7, y: 205 }
    },
    mounted () {
        this.appendMuteIconHTML()

        this.$nextTick(() => {
            this.adjustToPostText()
            this.triggerAutoplay()
            this.setPreviewHeight()
            this.measureInstagramThumbnailAspectRatio()
            if (this.format.id === 'FacebookCarouselAdPost') {
                this.attachEventListeners()
            }
        })
    },
    beforeDestroy () {
        if (this.format.id === 'FacebookCarouselAdPost') {
            this.detachEventListeners()
        }
    },
    methods: {
        adjustToPostText () {
            this.postTextHeight = this.$refs.postTextElement.clientHeight
        },
        appendMuteIconHTML () {
            // Need to do this manually as vue sets wrong namespace in foreigObjects, https://github.com/vuejs/vue/issues/4122
            // Will be fixed by upgrading vue to 2.5.14 but that breaks tests
            let containers = this.$el.querySelectorAll('.video__sound-icon-placeholder')
            containers.forEach((container) => {
                let element = document.createElementNS('http://www.w3.org/2000/svg', 'svg')
                element.setAttribute('width', 78)
                element.setAttribute('height', 78)
                element.setAttribute('viewBox', '0 0 78 78')
                element.setAttribute('class', 'video__sound-icon')
                element.innerHTML = template
                container.appendChild(element)
            })
        },
        measureInstagramThumbnailAspectRatio () {
            if (this.thumbnailUrl) {
                let self = this
                let img = new Image()
                img.onload = () => {
                    self.imageAspectRatio = img.width / img.height
                }
                img.src = this.thumbnailUrl
            }
        },
        toggleVideoSound () {
            this.videoMuted = !this.videoMuted
            this.$refs.video.muted = this.videoMuted
        },
        handleCarouselCardClick (index) {
            if (!this.shouldPreventCardClick) {
                this.videoMuted = !this.videoMuted
                this.$refs.carouselVideo[index].muted = this.videoMuted
            }
        },
        replayVideo (videoRef, videoId) {
            videoRef.pause()
            videoRef.currentTime = 0
            videoRef.play().then(() => {
                this.videoPlaying = videoId
            }).catch((error) => {
                console.error(error)
            })
        },
        handleVideosOnSwipeEnd () {
            let cardIndex = this.getCarouselPositions().indexOf(this.swipeOffset)
            this.carouselItems.forEach((c, index) => {
                if (this.carouselItems[index].videoUrl) {
                    this.$refs.carouselVideo[index].pause()
                    this.$refs.carouselVideo[index].currentTime = 0
                }
            })
            if (this.carouselItems[cardIndex].videoUrl) {
                this.videoMuted = true
                this.$refs.carouselVideo[cardIndex].muted = true
                this.positionVideo(this.$refs.carouselVideoPosition[cardIndex], this.$refs.carouselVideo[cardIndex])
                this.positionMuteIcons(this.$refs.carouselVideoPosition[cardIndex])
                this.replayVideo(this.$refs.carouselVideo[cardIndex], 'video' + cardIndex)
            } else if (this.carouselItems[cardIndex].animatedImageUrl) {
                this.playGif(this.$refs.carouselGif[cardIndex])
            }
            this.$refs.carouselSwipable.removeEventListener('transitionend', this.handleVideosOnSwipeEnd)
        },
        moveCarouselToFixedPosition () {
            let newSwipeOffset = this.getFixedCarouselPosition()
            if (this.shouldPreventCardClick) {
                this.$refs.carouselSwipable.addEventListener('transitionend', this.handleVideosOnSwipeEnd)
            }
            this.swipeOffset = this.startSwipeOffset = newSwipeOffset
            this.swipeRepositionVideos()
            this.carouselIndex = this.getCarouselPositions().indexOf(this.swipeOffset)
            // For carousel dots
            if (this.carouselIndex > this.bigDotsStartIndex + 2) {
                this.bigDotsStartIndex++
            }
            if (this.carouselIndex < this.bigDotsStartIndex) {
                this.bigDotsStartIndex--
            }
        },
        triggerAutoplay () {
            if (this.videoUrl) {
                this.$refs.video.muted = true
                this.playVideo(this.$refs.video, this.$refs.videoPosition, 'video')
                this.positionMuteIcons(this.$refs.videoPosition)
            } else if (this.animatedImageUrl) {
                this.playGif(this.$refs.gif)
            }
        },
        positionMuteIcons (positionRef) {
            this.$el.querySelectorAll('.video__sound-icon').forEach((e)=>{
                let boundingRect = positionRef.getBoundingClientRect()
                // Firefox positions foreignObject contents correctly, no need to translate them
                if (!IS_FIREFOX) {
                    e.style.transform = `translate(0px, ${boundingRect.top + window.scrollY}px)`
                }
            })
        },
        getCarouselPositions () {
            return this.carouselItems.map((_, idx) => -this.dimensions.width * idx)
        },
    },
}
</script>

<style lang="less">
    .video__sound-icon {
        position: absolute;
        left: 20px;
        bottom: 20px;
        width: 20px;
        height: 20px;
    }
</style>
